1. `deepMallocAndCopy<T>()` – one call allocates device memory for a host-side struct and all its pointer fields, then copies the host data (including deep pointer contents) in a single launch.  
2. `deepFree<T>()` – performs the mirror cleanup so every allocation site is paired with a single free site.

You can now replace lengthy sequences such as:

```cuda
Data* d_data;
cudaMalloc(&d_data, sizeof(Data));
cudaMemcpy(d_data, h_data, sizeof(Data), cudaMemcpyHostToDevice);

float* d_array;
cudaMalloc(&d_array, N * sizeof(float));
cudaMemcpy(d_array, h_data->array, N * sizeof(float), cudaMemcpyHostToDevice);
d_data->array = d_array;
```

with the concise:

```cuda
Data* d_data = deepMallocAndCopy(h_data);
...
deepFree(d_data);
```

The helpers handle arbitrarily many pointers inside one or more nested structs; no matter how complex your hierarchy becomes, these two calls remain sufficient.  
